import React from "react"
import { Player } from 'video-react';


function Vplayer () {
  const video = "videos/01.mp4"

  function handleEnd () {
    video = "videos/02.mp4"
  }
  return (
    <>
        <Player
          controls={false}
          playsInline
          fluid={true}
          autoPlay
          style={{display: 'none'}}
          src={video}
          onEnded={(handleEnd)}
        />
    </>
  )
}

export default Vplayer
